        "operationId": "generate-token(GeratokenBearerparasessão)",
        "parameters": [
          {
            "name": "secretkey",
            "in": "path",
            "description": "(Required) chave do admin",
            "required": true,
            "style": "simple",
            "schema": {
              "type": "string",
              "example": "THISISMYSECURETOKEN"
            }
          }
        ],
        "responses": {
          "201": {
            "description": "Created",
            "headers": {},
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/resultadocomsucessodacria%C3%A7%C3%A3odotoken"
                },
                "example": {
                  "status": "Success",
                  "session": "nova",
                  "token": "$2b$10$N9xrdqCW4S1jpNyB44L1nuXj79EAvo83MS6uxhBg8JOvWNLV8QlaS",
                  "full": "nova:$2b$10$N9xrdqCW4S1jpNyB44L1nuXj79EAvo83MS6uxhBg8JOvWNLV8QlaS"
                }
              }
            }
          }
        },
        "deprecated": false
      }
